INSERT INTO request_list_note VALUES ('54', '68', '7', 'Theerawat', 'ระบบ กวน ช่วยประสานงาน ตอนนี้สถานะล่าสุด มันยังเป็น ขออนุมัติส่ง สีเหลือง อยู่ ต้องเป็นผ่าน สีเขียว แล้วให้ผู้มีอำนาจเลื่อนไป เป็น 9 เดือนก่อนหรือป่าวครับ ตอนนี้เลย ยังไม่สามารถเลื่อนเป็น 9เดือนได้', '2011-07-11 15:33:17');
INSERT INTO request_list_note VALUES ('55', '68', '7', 'Theerawat', 'จากการตรวจสอบ ตอนนี้ ข้อมันยังไม่ได้ถูกเลื่อนไปขั้นที่ 9 \r\nตอนนี้ ยังทำการเลื่อนไปขั้นที่ 9 ไม่ได้ \r\nอยากสอบถามว่า สามารถให้ลบข้อมูล (ดูจากไฟล์แนบประกอบ) แถวที่ 9, 10 ได้มั้ยครับ เพราะ การจะเลื่อนไปขั้นที่ 9 ระบบสั่งให้เช็ค จากสถานะการพิจารณา ล่าสุด ซึ่งต', '2011-07-28 09:48:29');
